import "../style/RecipePage1.css";
import Header from "./Header";
import Footer from "./Footer";

function RecipePage1() {
  return (
    <>
      <Header />
      <section id="bigcake">
        <div className="bigcake-title">
        <ul>
          <img className="soy2" src="./images/recipe/soy_no leg2.png" alt="" />
          <h1>無麩純素熱帶水果椰奶蛋糕</h1>
        </ul>
        <ul >
        <img className="cherry2" src="./images/recipe/cherry_no leg2.png" alt="" />
        <img className="main_pic" src="./images/recipe/main.png" alt="" />
        </ul>
        </div>


      </section>
      <Footer/>
    </>
  );
}
export default RecipePage1;
